export default {
    mounted(el){
        const oContainer = el.querySelector('.container')
        console.log("el", oContainer)
        const oInputContainer = oContainer.querySelector('.input-container')
        console.log("style", oInputContainer.style);
        oInputContainer.addEventListener('focus', function(){
            console.log("style", oInputContainer.style);
            // oInputContainer.style
        }, false)

    }
}
